import React, { Component } from 'react'
import { Button, Form, Grid, Header, Image, Loader, Dimmer, Segment, Message } from 'semantic-ui-react';
import 'semantic-ui-css/semantic.min.css';
import axios from 'axios';
import { getEnterpriseById } from "../../../Store/actions/EnterpriseAction";
import { connect } from 'react-redux'
class Main extends Component {
    state = {
        loading: false,
        enterpId: null,
        permission: true,
        timeIsHoverError: "",
    }
    render() {
        return (
            <div>          
                   <h1 style={{textAlign:"center"}}>My Card/s</h1>
              
            </div>
        )
    }
}
const mapDispatchToProps = dispatch => {
    return {
        selectEnterprise: (id) => dispatch(getEnterpriseById(id)),
    }
}
export default connect(null, mapDispatchToProps)(Main);
